01365 bool XFILEJSON::DecodeAllLines()
01366 {
01367   if(root) delete root;
01368 
01369   if(!GetAllInOneLine(all)) return false;
01370 
01371   DeleteAllLines();
01372 
01373   //--------------------------------------------------------
01374   // Search Object Root
01375 
01376   int positionbracket = 0;
01377   int positionbrace   = 0;
01378   int position        = 0;
01379 
01380   if(!SearchControlCharacter(XFILEJSONCONTROLCHAR_OPENBRACKET, positionbracket)) positionbracket = 100000000;
01381   if(!SearchControlCharacter(XFILEJSONCONTROLCHAR_OPENBRACE  , positionbrace))   positionbrace   = 100000000;
01382 
01383   if(positionbracket > positionbrace)  position = positionbrace + 1;  else position =  positionbracket;
01384 
01385   root = new XFILEJSONOBJECT();
01386   if(!root) return false;
01387 
01388   bool status = DecodeObject(position, true, root);
01389 
01390   all.Empty();
01391 
01392   if(!status)
01393     {
01394       delete root;
01395       root = NULL;
01396     }
01397 
01398   return status;
01399 }
