01535         {
01536           XFILEJSONVALUE* value = (XFILEJSONVALUE*)array->GetValues()->Get(c);
01537           if(value)
01538             {
01539               switch(value->GetType())
01540                 {
01541                   case XFILEJSONVALUETYPE_OBJECT  :
01542                   case XFILEJSONVALUETYPE_ARRAY   : { XFILEJSONOBJECT* subobject = GetObjectSubValue(name, value);
01543                                                       if(subobject) return subobject;
01544                                                     }
01545                                                     break;
01546                                         default   : break;
01547                 }
01548             }
01549         }
01550     }
01551    else
01552     {
01553       XFILEJSONOBJECT* object = _startobject;
01554       if(!object) return NULL;
01555 
01556       if(!object->GetValues()) return NULL;
01557 
01558       for(int c=0; c<(int)object->GetValues()->GetSize();c++)
01559         {
