01623           if((type == XFILEJSONVALUETYPE_OBJECT) || (type ==  XFILEJSONVALUETYPE_ARRAY))
01624             {
01625               value = GetValue(name, (XFILEJSONOBJECT*)value->GetValuePointer());
01626               if(value) return value;
01627             }
01628            else
01629             {
01630               if(value->GetName())
01631                 {
01632                   if(!value->GetName()->Compare(name)) return value;
01633                 }
01634             }
01635         }
01636     }
01637 
01638   return NULL;
01639 }
