01726 XFILEJSONOBJECT* XFILEJSON::GetObjectSubValue(XCHAR* name, XFILEJSONVALUE* value)
01727 {
01728   XFILEJSONVALUETYPE type = value->GetType();
01729   if(value->GetName())
01730     {
01731       if(!value->GetName()->Compare(name))
01732         {
01733           switch(type)
01734             {
01735               case XFILEJSONVALUETYPE_OBJECT  :
01736               case XFILEJSONVALUETYPE_ARRAY   : return (XFILEJSONOBJECT*)value->GetValuePointer();
01737 
01738                                     default   : return NULL;
01739           }
01740         }
01741     }
01742 
01743   switch(type)
01744     {
01745       case XFILEJSONVALUETYPE_OBJECT  : { XFILEJSONOBJECT* subobject = GetObject(name, (XFILEJSONOBJECT*)value->GetValuePointer());
01746                                           if(subobject) return subobject;
01747                                         }
01748                                         break;
01749 
01750       case XFILEJSONVALUETYPE_ARRAY   : { XFILEJSONARRAY* subarray = (XFILEJSONARRAY*)value->GetValuePointer();
01751                                           if(subarray)
01752                                             {
01753                                               for(XDWORD d=0; d<subarray->GetValues()->GetSize(); d++)
01754                                                 {
01755                                                   XFILEJSONVALUE* subvalue = (XFILEJSONVALUE*)subarray->GetValues()->Get(d);
01756                                                   if(subvalue)
01757                                                     {
01758                                                       XFILEJSONOBJECT* subobject = GetObjectSubValue(name, subvalue);
01759                                                       if(subobject) return subobject;
01760                                                     }
01761                                                 }
01762                                             }
01763                                         }
01764                                         break;
01765 
01766                             default   : return NULL;
01767     }
01768 
01769   return NULL;
01770 }
