01786 bool XFILEJSON::DecodeObject(int& position, bool isobject, XFILEJSONOBJECT* object)
01787 {
01788   if(!object) return false;
01789 
01790   while(1)
01791     {
01792       XFILEJSONCONTROLCHAR ctrlchar;
01793 
01794       XFILEJSONVALUE* value = new XFILEJSONVALUE();
01795       if(!value) return false;
01796 
01797       if(isobject)
01798         {
01799           XSTRING name;
01800           int     checkposition = position;
01801 
01802           ctrlchar = SearchNextControlCharacter(checkposition);
01803           if(ctrlchar == XFILEJSONCONTROLCHAR_QUOTE)         
01804             {
01805               if(GetString(checkposition, name))
01806                 {
01807 
01808                 }
01809 
01810               position = checkposition;
01811             }
01812 
01813           value->SetName(name);
01814 
01815           if(!name.IsEmpty())
01816             {
01817               ctrlchar = SearchNextControlCharacter(position);
01818               if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01819                 {
01820                   delete value;
01821                   return false;
01822                 }
01823 
01824               position++;
01825             }
01826         }
01827 
01828       ctrlchar = SearchNextControlCharacter(position);
01829       switch(ctrlchar)
01830         {
01831           case XFILEJSONCONTROLCHAR_OPENBRACE     : { XFILEJSONOBJECT* newobject = new XFILEJSONOBJECT();
01832                                                       if(!object) return false;
01833 
01834                                                       value->Set(newobject);
01835 
01836                                                       position++;
01837 
01838                                                       if(!DecodeObject(position, true, newobject))
01839                                                         {
01840                                                           delete value;
01841                                                           return false;
01842                                                         }
01843 
01844                                                       object->GetValues()->Add(value);
01845                                                     }
01846                                                     break;
01847 
01848           case XFILEJSONCONTROLCHAR_OPENBRACKET   : { XFILEJSONARRAY* newarray = new XFILEJSONARRAY();
01849                                                       if(!object) return false;
01850 
01851                                                       value->Set(newarray);
01852 
01853                                                       position++;
01854 
01855                                                       if(!DecodeObject(position,false,(XFILEJSONOBJECT*)newarray))
01856                                                         {
01857                                                           delete value;
01858                                                           return false;
01859                                                         }
01860 
01861                                                       object->GetValues()->Add(value);
01862                                                     }
01863                                                     break;
01864 
01865           case XFILEJSONCONTROLCHAR_NUMBER        : { XSTRING valuestring;
01866                                                       bool    special = false;
01867 
01868                                                       GetNumber(position, valuestring, special);
01869 
01870                                                       if(!special)
01871                                                         {
01872                                                           int integer = 0;
01873 
01874                                                           valuestring.UnFormat(__L("%d"),&integer);
01875                                                           value->Set(integer);
01876                                                         }
01877                                                        else
01878                                                         {
01879                                                           double floating = 0.0f;
01880 
01881                                                           valuestring.UnFormat(__L("%f"), &floating);
01882 
01883                                                           value->Set((float)floating);
01884                                                         }
01885 
01886                                                       object->GetValues()->Add(value);
01887                                                     }
01888                                                     break;
01889 
01890           case XFILEJSONCONTROLCHAR_TEXT          : { XSTRING valuestring;
01891 
01892                                                       GetText(position, valuestring);
01893 
01894                                                       valuestring.ToUpperCase();
01895                                                       
01896                                                       value->Set();
01897 
01898                                                       if(!valuestring.Compare(__L("TRUE")))  value->Set(true);
01899                                                       if(!valuestring.Compare(__L("FALSE"))) value->Set(false);
01900                                                       
01901                                                       if(!valuestring.Compare(__L("null")))  value->Set();
01902 
01903                                                       object->GetValues()->Add(value);
01904                                                     }
01905                                                     break;
01906 
01907           case XFILEJSONCONTROLCHAR_QUOTE         : { XSTRING valuestring;
01908 
01909                                                       GetString(position,valuestring);
01910 
01911                                                       value->Set(valuestring);
01912 
01913                                                       object->GetValues()->Add(value);
01914                                                     }
01915                                                     break;
01916 
01917           case XFILEJSONCONTROLCHAR_CLOSEBRACE    :
01918           case XFILEJSONCONTROLCHAR_CLOSEBRACKET  : delete value;
01919                                                     break;
01920 
01921           case XFILEJSONCONTROLCHAR_NOTCONTROL    :
01922                                         default   : delete value;
01923                                                     return false;
01924 
01925         }
01926 
01927 
01928       ctrlchar = SearchNextControlCharacter(position);
01929       if(position != -1)
01930         {
01931           if(isobject)
01932             {
01933               if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACE)
01934                 {
01935                   position++;
01936                   break;
01937                 }
01938                else
01939                 {
01940                   if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01941                     {
01942                       return false;
01943                     }
01944                 }
01945             }
01946            else
01947             {
01948               if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACKET)
01949                 {
01950                   position++;
01951                   break;
01952                 }
01953                else
01954                 {
01955                   if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01956                     {
01957                       return false;
01958                     }
01959                 }
01960             }
01961 
01962           ctrlchar = SearchNextControlCharacter(position);
01963           if(ctrlchar!=XFILEJSONCONTROLCHAR_COMMA)
01964             {
01965               return false;
01966             }
01967            else
01968             {
01969               //-----------------------------------
01970               // COMMA is ADD to end (BAD JSON format)
01971 
01972               position++;
01973 
01974               ctrlchar = SearchNextControlCharacter(position);
01975               if(isobject)
01976                 {
01977                   if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACE)
01978                     {
01979                       position++;
01980                       break;
01981                     }
01982                    else
01983                     {
01984                       if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
01985                         {
01986                           return false;
01987                         }
01988                     }
01989                 }
01990                else
01991                 {
01992                   if(ctrlchar==XFILEJSONCONTROLCHAR_CLOSEBRACKET)
01993                     {
01994                       position++;
01995                       break;
01996                     }
01997                    else
01998                     {
01999                       if(ctrlchar == XFILEJSONCONTROLCHAR_NOTCONTROL)
02000                         {
02001                           return false;
02002                         }
02003                     }
02004                 }
02005             }
02006         }
02007        else
02008         {
02009           break;
02010         }
02011     }
02012 
02013   //XTRACE_PRINTCOLOR(2, __L("%d"), position);
02014 
02015   return true;
02016 }
