02018 
02030 XFILEJSONCONTROLCHAR XFILEJSON::CheckControlCharacter(XCHAR character)
02031 {
02032   XFILEJSONCONTROLCHAR ctrlchar;
02033 
02034   switch(character)
02035     {
02036       case __C('{')  : ctrlchar = XFILEJSONCONTROLCHAR_OPENBRACE;     break;
02037       case __C('}')  : ctrlchar = XFILEJSONCONTROLCHAR_CLOSEBRACE;    break;
02038       case __C('[')  : ctrlchar = XFILEJSONCONTROLCHAR_OPENBRACKET;   break;
02039       case __C(']')  : ctrlchar = XFILEJSONCONTROLCHAR_CLOSEBRACKET;  break;
02040       case __C('\"') : ctrlchar = XFILEJSONCONTROLCHAR_QUOTE;         break;
02041       case __C(',')  : ctrlchar = XFILEJSONCONTROLCHAR_COMMA;         break;
02042       case __C(':')  : ctrlchar = XFILEJSONCONTROLCHAR_COLON;         break;
02043       case __C('\\') : ctrlchar = XFILEJSONCONTROLCHAR_BLACKSLASH;    break;
02044 
02045       case __C('0')  :
02046       case __C('1')  :
02047       case __C('2')  :
02048       case __C('3')  :
02049       case __C('4')  :
02050       case __C('5')  :
02051       case __C('6')  :
02052       case __C('7')  :
02053       case __C('8')  :
02054       case __C('9')  :
02055       case __C('-')  : ctrlchar = XFILEJSONCONTROLCHAR_NUMBER;        break;
02056 
02057       case __C('.')  :
02058       case __C('+')  :
02059       case __C('e')  :
02060       case __C('E')  : ctrlchar = XFILEJSONCONTROLCHAR_NUMBERSPECIAL; break;
02061 
02062       case __C('\t') :
02063       case __C('\r') :
02064       case __C('\n') :
02065       case __C(' ')  : ctrlchar = XFILEJSONCONTROLCHAR_NOTCONTROL;    break;
02066 
02067            default   : ctrlchar = XFILEJSONCONTROLCHAR_TEXT;          break;
02068     }
02069 
02070   return ctrlchar;
02071 }
