02085 XCHAR XFILEJSON::GetControlCharacter(XFILEJSONCONTROLCHAR ctrlchar)
02086 {
02087   switch(ctrlchar)
02088     {
02089       case XFILEJSONCONTROLCHAR_OPENBRACE     : return __C('{');
02090       case XFILEJSONCONTROLCHAR_CLOSEBRACE    : return __C('}');
02091       case XFILEJSONCONTROLCHAR_OPENBRACKET   : return __C('[');
02092       case XFILEJSONCONTROLCHAR_CLOSEBRACKET  : return __C(']');
02093       case XFILEJSONCONTROLCHAR_QUOTE         : return __C('\"');
02094       case XFILEJSONCONTROLCHAR_COMMA         : return __C(',');
02095       case XFILEJSONCONTROLCHAR_COLON         : return __C(':');
02096       case XFILEJSONCONTROLCHAR_BLACKSLASH    : return __C('\\');
02097                                      default  : break;
02098     }
02099 
02100   return 0;
02101 }
