02140 XFILEJSONCONTROLCHAR XFILEJSON::SearchNextControlCharacter(int& position)
02141 {
02142   for(int c=position;c<(int)all.GetSize();c++)
02143     {
02144       XFILEJSONCONTROLCHAR ctrlchar;
02145 
02146       ctrlchar = CheckControlCharacter(all.Get()[c]);
02147       if(ctrlchar != XFILEJSONCONTROLCHAR_NOTCONTROL)
02148         {
02149           position = c;
02150           return ctrlchar;
02151         }
02152     }
02153 
02154   position = XSTRING_NOTFOUND;
02155 
02156   return XFILEJSONCONTROLCHAR_NOTCONTROL;
02157 }
