02172 bool XFILEJSON::SearchControlCharacter(XFILEJSONCONTROLCHAR ctrlchar, int& position)
02173 {
02174   for(int c=position;c<(int)all.GetSize();c++)
02175     {
02176       XFILEJSONCONTROLCHAR _ctrlchar;
02177 
02178       _ctrlchar = CheckControlCharacter(all.Get()[c]);
02179       if(_ctrlchar == ctrlchar)
02180         {
02181           position = c;
02182           return true;
02183         }
02184     }
02185 
02186   position = XSTRING_NOTFOUND;
02187   return false;
