02204 bool XFILEJSON::GetNumber(int& position, XSTRING& string, bool& special)
02205 {
02206   string.Empty();
02207 
02208   special = false;
02209 
02210   for(int c=position;c<(int)all.GetSize();c++)
02211     {
02212       XFILEJSONCONTROLCHAR ctrlchar;
02213 
02214       ctrlchar = CheckControlCharacter(all.Get()[c]);
02215       if((ctrlchar == XFILEJSONCONTROLCHAR_NUMBER)||(ctrlchar == XFILEJSONCONTROLCHAR_NUMBERSPECIAL))
02216         {
02217           string += all.Get()[c];
02218           if(ctrlchar == XFILEJSONCONTROLCHAR_NUMBERSPECIAL) special = true;
02219 
02220         }
02221        else
02222         {
02223           position = c;
02224           break;
02225         }
02226     }
02227 
02228   return string.IsEmpty()?false:true;
02229 }
