02251 
02252       ctrlchar = CheckControlCharacter(all.Get()[c]);
02253       if((ctrlchar == XFILEJSONCONTROLCHAR_TEXT) ||(ctrlchar == XFILEJSONCONTROLCHAR_NUMBERSPECIAL))
