02267 
02280 bool XFILEJSON::GetString(int& position, XSTRING& string)
02281 {
02282   string.Empty();
02283 
02284   XFILEJSONCONTROLCHAR ctrlchar;
02285 
02286   //----------------------------------
02287   // First Quote
02288   ctrlchar = CheckControlCharacter(all.Get()[position]);
02289   if(ctrlchar != XFILEJSONCONTROLCHAR_QUOTE) return false;
02290 
02291   position++;
02292 
02293   bool slashcontrol = false;
02294   bool exit         = false;
02295 
02296   for(int c=position;c<(int)all.GetSize();c++)
02297     {
02298       ctrlchar = CheckControlCharacter(all.Get()[c]);
02299 
02300       switch(ctrlchar)
02301         {
02302           case XFILEJSONCONTROLCHAR_NOTCONTROL    :
02303           case XFILEJSONCONTROLCHAR_OPENBRACE     :
02304           case XFILEJSONCONTROLCHAR_CLOSEBRACE    :
02305           case XFILEJSONCONTROLCHAR_OPENBRACKET   :
02306           case XFILEJSONCONTROLCHAR_CLOSEBRACKET  :
02307           case XFILEJSONCONTROLCHAR_COMMA         :
02308           case XFILEJSONCONTROLCHAR_COLON         :
02309           case XFILEJSONCONTROLCHAR_NUMBER        :
02310           case XFILEJSONCONTROLCHAR_NUMBERSPECIAL :
02311           case XFILEJSONCONTROLCHAR_TEXT          : string += all.Get()[c];
02312                                                     slashcontrol = false;
02313                                                     break;
02314 
02315           case XFILEJSONCONTROLCHAR_QUOTE         : if(slashcontrol)
02316                                                       {
02317                                                         string += all.Get()[c];
02318                                                         slashcontrol = false;
02319 
02320                                                       }
02321                                                      else exit = true;
02322                                                     break;
02323 
02324           case XFILEJSONCONTROLCHAR_BLACKSLASH    : slashcontrol = true;
02325                                                     string += all.Get()[c];
02326                                                     break;
02327         }
02328 
02329       if(exit)
02330         {
02331           position = (c + 1);
02332           break;
02333         }
02334     }
02335 
02336   return string.IsEmpty()?false:true;
02337 }
