02353 bool XFILEJSON::AddTabs(int level, int spacetabs, XSTRING& string)
02354 {
02355   if(spacetabs<=0) return false;
02356 
02357   for(int c=0;c<level;c++)
02358     {
02359       for(int d=0;d<spacetabs;d++)
02360         {
02361           string += __L(" ");
02362         }
02363     }
02364 
02365   return true;
02366 }
