02382 bool XFILEJSON::EncodeObject(bool isobject, XFILEJSONOBJECT* object, bool istabulatedline)
02383 {
02384   if(!object) return false;
02385 
02386   XSTRING line;
02387 
02388   if(istabulatedline)
02389     {
02390       AddTabs(encodelevel,XFILEJSON_SPACETABS,line);
02391       encodelevel++;
02392     }
02393 
02394   AddControlCharacter(isobject?XFILEJSONCONTROLCHAR_OPENBRACE:XFILEJSONCONTROLCHAR_OPENBRACKET, line);
02395   AddLine(line);
02396   //XTRACE_PRINTCOLOR(0,line.Get());
02397 
02398   for(int c=0;c<(int)object->GetValues()->GetSize();c++)
02399     {
02400       XFILEJSONVALUE* value = (XFILEJSONVALUE*)(object->GetValues()->Get(c));
02401       if(value)
02402         {
02403           line.Empty();
02404           AddTabs(encodelevel, XFILEJSON_SPACETABS, line);
02405 
02406           XSTRING* name = value->GetName();
02407           if(name)
02408             {
02409               if(!name->IsEmpty())
02410                 {
02411                   XSTRING line2;
02412 
02413                   line2.Format(__L("%c%s%c : "), GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE), name->Get() , GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE));
02414                   line+=line2;
02415                 }
02416             }
02417     
02418           switch(value->GetType())
02419             {              
02420               case XFILEJSONVALUETYPE_NULL            : line += __L("null");
02421                                                         break;
02422 
02423 
02424 
02425               case XFILEJSONVALUETYPE_STRING          : { XSTRING  ptrvaluestring = value->GetValueString();
02426                                                           XSTRING  valuestring;
02427                                                          
02428                                                           valuestring.Format(__L("%c%s%c"), GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE), ptrvaluestring.Get(), GetControlCharacter(XFILEJSONCONTROLCHAR_QUOTE));
02429                                                           line += valuestring.Get();
02430                                                         }
02431                                                         break;              
02432 
02433               case XFILEJSONVALUETYPE_OBJECT          : { XFILEJSONOBJECT* newobject = (XFILEJSONOBJECT*)(value->GetValuePointer());
02434                                                           if(newobject)
02435                                                             {
02436                                                               if((!line.IsEmpty()) && line.HaveCharacters())
02437                                                                 {
02438                                                                   AddLine(line);
02439                                                                   //XTRACE_PRINTCOLOR(0,line.Get());
02440                                                                 }
02441 
02442                                                               if(!EncodeObject(true,newobject,istabulatedline)) return false;
02443                                                               line.Empty();
02444                                                             }
02445                                                         }
02446                                                         break;
02447 
02448               case XFILEJSONVALUETYPE_ARRAY           : { XFILEJSONARRAY* newarray = (XFILEJSONARRAY*)(value->GetValuePointer());
02449                                                           if(newarray)
02450                                                             {
02451                                                               if((!line.IsEmpty()) && line.HaveCharacters())
02452                                                                 {
02453                                                                   AddLine(line);
02454                                                                   //XTRACE_PRINTCOLOR(0,line.Get());
02455                                                                 }
02456 
02457                                                               if(!EncodeObject(false,(XFILEJSONOBJECT*)newarray,istabulatedline)) return false;
02458                                                               line.Empty();
02459                                                             }
02460                                                         }
02461                                                         break;  
02462 
02463                                     default           : { XSTRING valuestring;
02464 
02465                                                           value->GetValue()->ToString(valuestring);
02466 
02467                                                           line += valuestring.Get();   
02468                                                         }
02469                                                         break;  
02470         
02471             }
02472         }
02473 
02474       if(c!=(int)(object->GetValues()->GetSize()-1))
02475         {
02476           if(line.IsEmpty()) AddTabs(encodelevel,XFILEJSON_SPACETABS,line);
02477 
02478           AddControlCharacter(XFILEJSONCONTROLCHAR_COMMA, line);
02479         }
02480 
02481       if(!line.IsEmpty())
02482         {
02483           AddLine(line);
02484           //XTRACE_PRINTCOLOR(0,line.Get());
02485         }
02486 
02487       line.Empty();
02488     }
02489 
02490   line.Empty();
02491 
02492   if(istabulatedline)
02493     {
02494       encodelevel--;
02495       AddTabs(encodelevel,XFILEJSON_SPACETABS,line);
02496     }
02497 
02498   AddControlCharacter(isobject?XFILEJSONCONTROLCHAR_CLOSEBRACE:XFILEJSONCONTROLCHAR_CLOSEBRACKET, line);
02499   AddLine(line);
02500 
02501   //XTRACE_PRINTCOLOR(0,line.Get());
02502 
02503   return true;
02504 }
